biography_text:
There are at least five artists which have used the name Girls:
1) an indie rock band from the United States;
2) a girl group from Brazil;
3) a rock band from Japan;
4) a synthpop group from Sweden;
5) a punk band from the United States.

1) In 2006, Christopher Owens, Liza Thorn, Ryan Lynch (from Dominant Legs) began a music project called Curls, which dissolved itself when Liza decided to focus more on her new band, Bridez. Not to be dissuaded, <a href="https://www.last.fm/music/Girls">Read more on Last.fm</a>

There are several artists named 'Nirvana';

1) Nirvana was an American grunge band. The band formed in Aberdeen, Washington in 1987, and it was part of the Seattle grunge scene of the late 80s, alongside bands like Pearl Jam, Alice in Chains and Soundgarden. As their popularity rose, alternative rock became a dominant genre on American and Canadian radio and music television during the early-to-mid '90s.

In late 1987, Cobain and Novoselic recruited drummer Aaron Burckhard (1987–1988). <a href="https://www.last.fm/music/Nirvana">Read more on Last.fm</a>

There are several artists named Idlewild;

1) Idlewild is a rock band which formed in Edinburgh, Scotland in 1995. The band currently comprises of Roddy Woomble (lead vocals), Rod Jones (guitar, backing vocals), Colin Newton (drums), Andrew Mitchell (bass/guitar) and Luciano Rossi (keyboard). They are joined on tour at present by Hannah Fisher (fiddle).

The band has released "Hope is Important" (1998), "100 Broken Windows" (2000), "The Remote Part" (2002) <a href="https://www.last.fm/music/Idlewild">Read more on Last.fm</a>

The Artist name Beck can refer to two artists;

1) Beck Hansen (born Bek David Campbell, July 8, 1970) is an American musician, singer-songwriter, and multi-instrumentalist.  Beck's music is known for its pop-junk culture collage of musical styles, ironic lyrics, samples, drum machines, live instrumentation and heady sound effects.

Beck was born in Los Angeles, California, to David Campbell (a musician and son of a Presbyterian minister) and Bibbe Hansen (a former dancer for The Velvet Underground <a href="https://www.last.fm/music/Beck">Read more on Last.fm</a>

There are several acts by the name of Disturbed;

1) Well-known American hard rock band with lead singer David Draiman, formed in 1996, with several albums including The Sickness (Giant/Reprise 2000), Believe (Giant/Reprise 2002), Ten Thousand Fists (Reprise, 2005), Indestructible (Reprise, 2008), Asylum (Reprise, 2010), and Immortalized (Reprise, 2015).
2) Late 80's American Thrash band who released the album Disturbing the Peace in 1988; formed by Earl Root in 86/87 and disbanded in 92/93 before his death in 2008. <a href="https://www.last.fm/music/Disturbed">Read more on Last.fm</a>

